-- 2. Insert States (Subdivisions)
INSERT INTO "country_subdivision" ("country_id", "name", "type", "is_active")
SELECT c.id, 'Southern Nations, Nationalities, and Peoples', 'state', true 
FROM "countries" c 
WHERE c."iso2" = 'ET'
AND NOT EXISTS (
    SELECT 1 FROM "country_subdivision" s 
    WHERE s.country_id = c.id 
    AND s.name = 'Southern Nations, Nationalities, and Peoples'
);
